      a[href^="http://www.cnzz.com"] {
          display: none
      }
      a[title="站长统计"]{
          display:none
      }
      html,body {
          height:100%;
          overflow: hidden;
      }
      #content {
          width: 100%;
          height: 100%;
          display: flex;
          align-items: stretch;
          flex-wrap:wrap;
      }
      #div3d {
          z-index: 1;
          flex: auto;
      }
      #div2d {
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
      }
      #div2d > div{
          z-index: 2;
      }
      #div2d > div .ThingJS_nav-vertical{
          overflow: auto;
          max-height: 100%;
      }
      #div2d > div .ThingJS_nav-vertical::-webkit-scrollbar {
          width: 6px;
          height: 6px;
      }
      #div2d > div .ThingJS_nav-vertical::-webkit-scrollbar-thumb {
          -webkit-box-shadow: inset 0 0 4px rgba(0, 0, 0, 0.35);
          background: #c3c3c3;
          border: 1px solid rgba(0, 0, 0, 0.1);
          border-radius: 3px;
      }
      #content .ThingJS-Banner-top {
          width: 100%;
          height: 50px;
          z-index: 10002;
      }
      #content .ThingJS-Banner-left {
          width: 60px;
          z-index: 10001;
      }
      #content .ThingJS-Banner-top + .ThingJS-banner-left {
          height: calc(100% - 50px);
      }
      #content.ThingJS-top #div3d {
          width: 100%;
          height: calc(100% - 50px);
      }
      #content.ThingJS-top #div2d {
          top: 50px;
          height: calc(100% - 50px);
      }
      #content.ThingJS-left #div2d {
          left: 60px;
          width: calc(100% - 60px);
      }
      #content.ThingJS-left #div3d {
          width: calc(100% - 60px);
      }
      #content.ThingJS-top .ThingJS_Banner-top{
          flex-shrink: 1;
          flex-direction: row;
          flex-wrap: nowrap;
          display: flex;
      }
      #content.ThingJS-top .ThingJS_Banner-top.ThingJS_nav-vertical .menu1{
          min-width: 150px;
          overflow: visible;
      }
      #content.ThingJS-top .ThingJS_nav-vertical .menu1 .menu1:last-child{
          overflow: hidden;
      }
  </style>

r/DIY/panel/css/panel.css">.ThingJS_wrap {
width: 100%;
height: 100%;
}
.ThingJS_wrap * {
margin: 0;
padding: 0;
box-sizing: border-box;
}
.ThingJS_wrap ul,
.ThingJS_wrap li {
list-style: none;
}
.ThingJS_wrap .panel {
position: absolute;
border: 1px solid #14171c;
background: linear-gradient(0deg, #1e202a 0%, #0d1013 100%);
box-shadow: 0px 2px 21px 0px rgba(33, 34, 39, 0.55);
border-radius: 4px;
}
.ThingJS_wrap .panel .main {
border: 1px solid #505050;
border-radius: 4px;
opacity: 0.96;
}
.ThingJS_wrap .panel .title {
height: 38px;
background: linear-gradient(0deg, #252935 0%, #2b2e3a 100%);
border-radius: 2px 2px 0px 0px;
position: relative;
border-bottom: 1px solid #0D1013;
}
.ThingJS_wrap .panel .title .text {
font-size: 14px;
font-family: 'MicrosoftYaHei';
font-weight: 400;
color: #dcdcdc;
line-height: 38px;
padding-left: 20px;
}
.ThingJS_wrap .panel .title .close {
position: absolute;
top: 14px;
right: 14px;
width: 10px;
height: 10px;
background: url('https://www.thingjs.com/static/r/DIY/panel/css/../images/panel/icon-close.png') no-repeat;
cursor: pointer;
}
.ThingJS_wrap .panel .ThingJS_hide {
display: none;
}
.ThingJS_wrap .panel .tab-box {
height: 38px;
background: linear-gradient(0deg, #2b2e3a 0%, #252935 100%);
border-bottom: 1px solid #0D1013;
position: relative;
}
.ThingJS_wrap .panel .tab-box::after {
content: '';
background: linear-gradient(0deg, #2b2e3a 0%, #252935 100%);
width: 100%;
height: 1px;
position: absolute;
top: -1px;
left: 0;
}
.ThingJS_wrap .panel .tab-box .tab {
height: 29px;
background: #3d414c;
border: 1px solid #27292e;
border-radius: 4px;
margin: 0 13px;
padding: 0 0 8px 0;
}
.ThingJS_wrap .panel .tab-box .tab .tabb {
border: 1px solid #444444;
border-radius: 4px;
overflow: hidden;
}
.ThingJS_wrap .panel .tab-box .tab .span-tab {
float: left;
min-width: 97px;
font-size: 14px;
font-family: 'MicrosoftYaHei';
font-weight: 400;
color: #ffffff;
line-height: 25px;
opacity: 0.4;
border-left: 1px solid #1a2028;
text-align: center;
height: 25px;
cursor: pointer;
}
.ThingJS_wrap .panel .tab-box .tab .ThingJS_tab-lied {
background: #1b1e25;
font-size: 14px;
font-family: 'MicrosoftYaHei';
font-weight: 400;
color: #ffffff;
opacity: 1;
}
.ThingJS_wrap .panel .dv-string {
padding: 0 10px;
}
.ThingJS_wrap .panel .dv-string .p1 {
border-top: 1px solid #303030;
padding: 0 21px;
display: flex;
flex-wrap: wrap;
justify-content: space-between;
font-size: 14px;
font-family: 'MicrosoftYaHei';
font-weight: 400;
color: #ffffff;
line-height: 36px;
}
.ThingJS_wrap .panel .dv-string .p1 span {
word-break: break-all;
text-align: justify;
}
.ThingJS_wrap .panel .dv-string .p1 .span3 {
width: 16px;
height: 16px;
background: url('https://www.thingjs.com/static/r/DIY/panel/css/../images/panel/icon-daohang.png') no-repeat;
